import "./App.css";
import { useState } from "react";

function App() {
  const [count, setCount] = useState(0);
  const increaseCount = () => {
    setCount(count + 1);
  };
  const decreaseCount = () => {
    setCount(count - 1);
  };
  const setToZero = () => {
    setCount(count = 0);
  };
  return (
    <div className="App">
      <button onClick={increaseCount}>increase</button>
      <button onClick={decreaseCount}>decrease</button>
      <button onClick={setToZero}>set to 0</button>
      <h1>{count}</h1>
    </div>
  );
}

export default App;
